import React from "react";
import "./App.css";
import Details from "./image1";
import MiddleRight from './MiddleRightSide';
import PersonalDetails from './PesronalDetails';


function Left() {
    return (
        <div>
            <div className="lcol ">
                <h3 className="name-title">Hajar Amara</h3>
                <Details />
            </div>
            <div className="mcol">
                <MiddleRight />
            </div>
            <div className=" rcol">
                <PersonalDetails />
            </div>
            <div>
            </div>
        </div>
    );
}

export default Left;
